import React, {useEffect, useState} from "react";
import logo from './logo.svg';
import {useLocation} from "react-router-dom";

export default function User(props) {
    const { state } = useLocation();
    const [currentUserName, setCurrentUserName] = useState("default");
    const [currentUserUID, setCurrentUserUID] = useState(() => state['UID'])
    const [currentUserPassword, setCurrentUserPassword] = useState("default");

    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo"/>
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
                <p>{currentUserName}</p>
                <p>{currentUserUID}</p>
                <p>{currentUserPassword}</p>
            </header>
        </div>
    )
}
